import './App.css';
import React from "react";
import { Unity, useUnityContext } from "react-unity-webgl";

function App() {
  const { unityProvider } = useUnityContext({
    loaderUrl: "public/Build/MergePuzzle.loader.js",
    dataUrl: "public/Build/MergePuzzle.data",
    frameworkUrl: "public/Build/MergePuzzle.framework.js",
    codeUrl: "public/Build/MergePuzzle.wasm",
  });

  return (
    <div className="App">
      <header className="App-header">
        <Unity
          unityProvider={unityProvider}
          style={{
            width: 800,
            height: 600,
            border: "2px solid #222",
            background: "#222",
          }}
        />
      </header>
    </div>
  );
}

export default App;
